import React from 'react';
import logo from './logo.svg';
import './Header.css';

function HeaderContent() {
  return (
    <div>
      <p className="lead">
        Let's learn React by building simple interfaces wtih components. Don't
        try to overthink, it, just keep it simple and have fun. Once you feel
        comfortable using components you are well on your way to mastering
        React!
      </p>

      <div className="card">
        <img
          src={logo}
          alt="React Logo"
          className="card-img-top bg-dark"
          height="300"
        />
        .
      </div>
    </div>
  );
}

export default HeaderContent;
